import header from "../images/bgi.jpg";
import { Container, Row } from "react-bootstrap";
import React from "react";

export default function Banner() {
  return (
    <>
      <section className="banner" id="home"></section>
      <Container>
        <Row className="align-items-center">
          <Col xs={12}></Col>
        </Row>
      </Container>
    </>
  );
}
